import React from 'react';
import {Route} from 'react-router-dom'
import './App.scss'
import HomePage from './pages/homepage/homepage.component'

const HatsPage=()=>(
  <div>
    <h1>Hats page</h1>
  </div>
)

function App() {
  return (
    <div>
      <Route exact path='/' component={HomePage}></Route>
      <Route  path='/hats' component={HomePage}></Route>

    </div>
  );
}

export default App;
